import React from "react";
import "../style/styles.css";
import Header from "../componentes/Header";
import MainRegistro from "../componentes/MainRegistro";

export default function Registro() {
  return (
    <div>
      <Header boton="Ingresa" link="./" />
      <MainRegistro />
    </div>
  );
}
